void ContactSECylinderSECylinder::InitializeConvectiveRange()
{
	//Degeneration
	if (sA->deg_u1 == true)
	{
		(*convective_min)(0, 0) = sA->deg_u1_value;
		(*convective_max)(0, 0) = sA->deg_u1_value;
		(*convective_range)(0, 0) = 0.0;
	}
	//No degeneration
	else
	{
		(*convective_min)(0, 0) = -1.0;
		(*convective_max)(0, 0) = +1.0;
		(*convective_range)(0, 0) = 2.0;
	}
	
	//Degeneration
	if (sA->deg_u2 == true)
	{
		(*convective_min)(1, 0) = sA->deg_u2_value;
		(*convective_max)(1, 0) = sA->deg_u2_value;
		(*convective_range)(1, 0) = 0.0;
	}
		
	//No degeneration
	else
	{
		(*convective_min)(1, 0) = 0;
		(*convective_max)(1, 0) = 2 * PI;
		(*convective_range)(1, 0) = 2 * PI;
	}
		
	//Degeneration
	if (sB->deg_u1 == true)
	{
		(*convective_min)(2, 0) = sB->deg_u1_value;
		(*convective_max)(2, 0) = sB->deg_u1_value;
		(*convective_range)(2, 0) = 0.0;
	}
	//No degeneration
	else
	{
		(*convective_min)(2, 0) = -1.0;
		(*convective_max)(2, 0) = +1.0;
		(*convective_range)(2, 0) = 2.0;
	}

	//Degeneration
	if (sB->deg_u2 == true)
	{
		(*convective_min)(3, 0) = sB->deg_u2_value;
		(*convective_max)(3, 0) = sB->deg_u2_value;
		(*convective_range)(3, 0) = 0.0;
	}

	//No degeneration
	else
	{
		(*convective_min)(3, 0) = 0;
		(*convective_max)(3, 0) = 2 * PI;
		(*convective_range)(3, 0) = 2 * PI;
	}

	//Setting the minimum convective range
	minimum_convective_range = 1e100;
	for (int i = 0; i < 4; i++)
	{
		if ((*convective_range)(i, 0) < minimum_convective_range && (*convective_range)(i, 0) != 0.0)
			minimum_convective_range = (*convective_range)(i, 0);
	}
}

//Verifica range de coordenadas convectivas
int ContactSECylinderSECylinder::VerifyConvectiveRange(Matrix& mc)
{
	//Retornos:
	//0 - Range fisico da superficie
	//4 - Fora do range fisico da superficie

	//Se está no range local de interesse - domínio físico da superfície
	if (abs(mc(0, 0)) < 1.0 && abs(mc(2, 0)) < 1.0)
	{
		return 0;	//Houve convergência, está no range físico
	}
	else
	{
		if ((sA->deg_u1 && abs(mc(2, 0)) < 1.0))
			return 0;	//coordenada u1 da superfície B no range e degeneração da coordenada u1 da superfície A.
		if ((sB->deg_u1 && abs(mc(0, 0)) < 1.0))
			return 0;	//coordenada u1 da superfície A no range e degeneração da coordenada u1 da superfície B.
		if (sA->deg_u1 && sB->deg_u1)
			return 0;	//coordenada u1 da superfície A no range e degeneração da coordenada u1 da superfície B.
		return 4;
	}
		

	
	
}



